const AppReducer = (state, action) => {
  console.log("state ", state);
  console.log("action", action.type);
  console.log("payload", action.payload);

  switch (action.type) {
    case "UPDATE_EXCESS":
      return {
        ...state,
        inc_benefits: { ...state.inc_benefits.excess, excess: action.payload },
      };
    case "UPDATE_PVT":
      return {
        ...state,
        inc_benefits: { ...state.inc_benefits, pvt: action.payload },
      };
    case "UPDATE_PHCF":
      return {
        ...state,
        inc_benefits: { ...state.inc_benefits, phcf: action.payload },
      };
    case "UPDATE_AA_RESCUE":
      return {
        ...state,
        inc_benefits: { ...state.inc_benefits, aa_rescue: action.payload },
      };

    case "SET_COMPARISON_ITEMS":
      return {
        ...state,
        to_compare: action.payload,
      };
    case "SET_CAR_INFO":
      return {
        ...state,
        car_info: action.payload,
      };
    default:
      return state;
  }
};

export default AppReducer;
